import styled from "styled-components";

const TodoContSection = styled.section`
  width: 512px;
  height: 768px;

  margin: 60px auto;
  position: relative;
  background-color: tomato;
`;

export default function TodoContainer({ children }) {
  return <TodoContSection>{children}</TodoContSection>;
}
